import React from 'react';
import {Button} from 'rebass'
import { NavLink } from 'react-router-dom'
import Boop from './Boop.js'

const buttonStyle = {
  background: '#45A29E',
  color: 'white',
  width: '15%',
  float: 'left'
}

const HomeButton = () => {
  return (
  <Boop scaleAmount={1.1} style={buttonStyle}>
    <NavLink style={buttonStyle} exact activeClassName="current" to={'./'}>
      <Button>
        Home
      </Button>
    </NavLink>
  </Boop>
  )
}

export default HomeButton;
